import React from "react";
import  ReactDOM  from "react-dom";
import App from "./App"
import WebFont from "webfontloader";

useEffect(() => {
    WebFont.load({
      google: {
        families: ['Inter', '']
      }
    });
   }, []);

const root = ReactDOM.createRoot(document.getElementById("root"))
root.render(<App/>)
